import React, { Component } from "react";

class Card extends Component {
  render() {
    return (
      <div className="wrapper">
        <div className="image">{this.props.children}</div>
        <button>b1</button>
        <button>b2</button>
        <button>b3</button>
      </div>
    );
  }
}

export default Card;
